import React from "react";
import "./Login.css"; // Importing the CSS file

const ClearOutput = () => {
    const Email = document.getElementById('email-address');
    const Password = document.getElementById('password');

    if (!(Email === "") || !(Password === "")) {
        Email.value = "";
        Password.value = "";
    }
};

const LoginBtn = () => {};

const Login = () => {
    return (
        <>
            <main className="pa6 black-80 vh-100 w-100">
                <form className="measure center">
                    <fieldset id="sign_up" className="ba b--transparent ph0 mh0">
                        <legend className="tc f1 fw6 ph0 mh0">Student Log In</legend>
                        <div className="mt3">
                            <label className="db fw6 lh-copy f6" htmlFor="email-address">Email</label>
                            <input className="pa2 input-reset ba   w-100 rounded-input" type="email" name="email-address" id="email-address" />
                        </div>
                        <div className="mv3">
                            <label className="db fw6 lh-copy f6" htmlFor="password">Password</label>
                            <input className="b pa2 input-reset ba   w-100 rounded-input" type="password" name="password" id="password" />
                        </div>
                    </fieldset>

                    <div className="lh-copy mt-1">
                        <a href="#0" className="f6 link dim black db">Forgot your password?</a>
                    </div>

                    <div className="">
                        <input className="f6 grow no-underline br-pill ba bw1 ph3 pv2 mb2 dib dark-blue" type="submit" value="Log In" onClick={LoginBtn} />
                        <input className="f6 grow no-underline br-pill ba bw1 ph3 pv2 mb2 dib dark-blue" type="reset" value="Clear" onClick={ClearOutput} />
                    </div>
                </form>
            </main>
            <div className="blue-box"></div>
            <div className="Login">
                <footer className="footer">
                <small className="copyright">Â© Created by Group CC, All Rights Reserved.</small>
                </footer>
            </div>
        </>
    );
}

export default Login;
